const initialState = {
  images: [],
  selectedImage: null,
};

function appReducer(state = initialState, { type, payload }) {
  // eslint-disable-next-line default-case
  switch (type) {
    case 'console':
      console.log('kuku');
  }
}

export default appReducer;
